function remplace(char)
  {
   var chaine = char;
  chaine = chaine.replace("'","0"); 
  return chaine;
  }
  
function deremplace(char)
  {
   var chaine = char;
  chaine = chaine.replace("0","'"); 
  return chaine;
  }
  
function normalize(char)
  {
   var chaine = char;
  chaine = chaine.toUpperCase();
  chaine = chaine.replaceAll("-"," ");
  chaine = chaine.replaceAll("'"," "); 
  chaine = replaceSpecialChars(chaine);
  return chaine;
  }
  
